import React, { useState } from "react";
import "./Teams.css";

type ButtonStyle = React.CSSProperties & {
    backgroundColor: "#686F7D" | "transparent",
    color: "white" | "#686F7D",
}

function Button({
    name,
    selected,
    onClick,
  }: {
    name: String;
    selected: boolean;
    onClick: () => void;
  }) {
    const buttonStyle: ButtonStyle = {
        backgroundColor: selected ? "#686F7D" : "transparent", 
        color: selected ? "white" : "#686F7D",
    }

    return (
      <button
        className={`person ${selected ? 'selected' : ''}`}
        style={buttonStyle}
        onClick={onClick}
      >
        {name}
      </button>
    );
  }

export default function Teams() {
    const [person, setPerson] = useState<String>('');

    const onClick = (name: String) => {
        if(name === person) {
            setPerson('');
        } else {
            setPerson(name);
        }

    }

  return (
    <div className="team-list">
      <div className="team-container">
        <div className="team-content">
          <div className="team-header">TEAM 1 TOTAL POINTS</div>
          <div className="points">
            <div className="current">1000</div>
            <div className="max">/ 9700</div>
          </div>
          <div className="members">
            <Button name="Michael" selected={person==="Michael"} onClick={() => onClick('Michael')}/>
            <Button name="Kevin" selected={person==="Kevin"} onClick={() => onClick('Kevin')}/>
            <Button name="Bob" selected={person==="Bob"} onClick={() => onClick('Bob')}/>
            <Button name="Larissa" selected={person==="Larissa"} onClick={() => onClick('Larissa')}/>
            <Button name="Gabby" selected={person==="Gabby"} onClick={() => onClick('Gabby')}/>
          </div>
        </div>
      </div>
      <div className="team-container">
        <div className="team-content">
          <div className="team-header">TEAM 2 TOTAL POINTS</div>
          <div className="points">
            <div className="current">1000</div>
            <div className="max">/ 9700</div>
          </div>
          <div className="members">
            <Button name="Michael" selected={person==="Michael"} onClick={() => onClick('Michael')}/>
            <Button name="Kevin" selected={person==="Kevin"} onClick={() => onClick('Kevin')}/>
            <Button name="Bob" selected={person==="Bob"} onClick={() => onClick('Bob')}/>
            <Button name="Larissa" selected={person==="Larissa"} onClick={() => onClick('Larissa')}/>
            <Button name="Gabby" selected={person==="Gabby"} onClick={() => onClick('Gabby')}/>
          </div>
        </div>
      </div>
      <div className="team-container">
        <div className="team-content">
          <div className="team-header">TEAM 3 TOTAL POINTS</div>
          <div className="points">
            <div className="current">1000</div>
            <div className="max">/ 9700</div>
          </div>
          <div className="members">
            <Button name="Michael" selected={person==="Michael"} onClick={() => onClick('Michael')}/>
            <Button name="Kevin" selected={person==="Kevin"} onClick={() => onClick('Kevin')}/>
            <Button name="Bob" selected={person==="Bob"} onClick={() => onClick('Bob')}/>
            <Button name="Larissa" selected={person==="Larissa"} onClick={() => onClick('Larissa')}/>
            <Button name="Gabby" selected={person==="Gabby"} onClick={() => onClick('Gabby')}/>
          </div>
        </div>
      </div>
    </div>
  );
}
